import React, { Component } from 'react';
import Homehead from './Homehead';
import Homeswiper from './Homeswiper';
import Homelist from './Homelist';
import axios from 'axios'

class Home extends Component {
    state = {
        datalist:[]
    }
    componentDidMount() {
        axios.get('https://api9.wochu.cn/api/app/acts?version=20.0.0&source=H')
            .then(res => {
                console.log(res.data.data.acts);
                this.setState({
                    datalist: res.data.data.acts
                })
                
            })
    }
    render() {
        return (
            <div>
                <Homehead />
                <Homeswiper />
                <Homelist />
            </div>
        )
    }
}


export default Home
